import React from "react";
import "../styles/branchSelection.css";

const Home = () => {
  const branches = [
    {
      name: "BCA",
      shape: "square",
      description: "View attendance details for the Bachelor of Computer Applications (BCA) branch.",
    },
    {
      name: "BCOM",
      shape: "circle",
      description: "Check attendance records for the Bachelor of Commerce (BCOM) branch.",
    },
    {
      name: "BA",
      shape: "triangle",
      description: "Review attendance overview for the Bachelor of Arts (BA) branch.",
    },
  ];

  return (
    <div className="branch-container">
      <h1 className="branch-title">Attendance</h1>

      <div className="branch-preview">
        <div className="shape-group">
          <div className="shape square"></div>
          <div className="shape circle"></div>
          <div className="shape triangle"></div>
        </div>
      </div>

      <hr className="divider" />

      <div className="branch-cards">
        {branches.map((branch, index) => (
          <div key={index} className="branch-card">
            <div className={`branch-icon ${branch.shape}`}></div>
            <h2>{branch.name}.</h2>
            <p>{branch.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
